webpackJsonp([85002196185678],{383:function(A,e){A.exports={data:{site:{siteMetadata:{title:"jackyzhen.com",subtitle:"A Software Developer living in Auckland, NZ",url:"https://jackyzhen.com"}},markdownRemark:{id:"/Users/jackyzhen/go/src/github.com/jackyzhen/jackyzhen.com/src/pages/articles/2018-08-28---In-the-Beginning-There-Was-Darkness/index.md absPath of file >>> MarkdownRemark",html:'<p>Hey there, welcome to this tiny little corner of the world wide netscape I call my website.</p>\n<p>This is your typical first post of the typical personal blog of a typical software developer.\nWhy am I doing this blogging thing? That’s a very boring and typical question to ask myself.</p>\n<h2>The Why, in Bullet Points</h2>\n<ul>\n<li>I want to be better at communicating via written form. I communicate a lot with code, not a lot with words.</li>\n<li>I want to write more. I haven’t written anything meaningful since university.</li>\n<li>I’m always learning new tech. A good way to learn is to try to teach. A great way to learn is to try to teach by writing for a hypothetical audience.</li>\n<li>Everybody else is doing it. Like with bitcoin, I fear missing out.</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/thinking-man-statue-4719fd92cf3102107f6e0c72be1e5755-473e3.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 360px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="thinking-man-statue.jpg"\n        title=""\n        src="/static/thinking-man-statue-4719fd92cf3102107f6e0c72be1e5755-473e3.jpg"\n        srcset="/static/thinking-man-statue-4719fd92cf3102107f6e0c72be1e5755-70611.jpg 240w,\n/static/thinking-man-statue-4719fd92cf3102107f6e0c72be1e5755-473e3.jpg 360w"\n        sizes="(max-width: 360px) 100vw, 360px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><em>Google image says this is a statue of Plato in thought. I like to think he is facepalming at the sight of yet another blog by another software guy.</em></p>\n<p>Why do they call them bullet points? What did they call them before guns were invented? Arrow dents?</p>\n<p>Are you still reading? Why?</p>\n<h2>The What, in Arrow Dents</h2>\n<p>In the future you can expect from this blog:</p>\n<ul>\n<li>Tech stuff. Yeah, that’s super vague.</li>\n<li>Satire and bad comedy.</li>\n<li>Uninformed thoughts and onions.</li>\n<li><del>Stolen</del> Referenced and recommended material.</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/leonardo-vitruvian-man-b-0cb3ceae967c83e16a33e15a5cc878ae-1caba.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 400px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.49999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="leonardo-vitruvian-man-b.jpeg"\n        title=""\n        src="/static/leonardo-vitruvian-man-b-0cb3ceae967c83e16a33e15a5cc878ae-1caba.jpeg"\n        srcset="/static/leonardo-vitruvian-man-b-0cb3ceae967c83e16a33e15a5cc878ae-38c71.jpeg 240w,\n/static/leonardo-vitruvian-man-b-0cb3ceae967c83e16a33e15a5cc878ae-1caba.jpeg 400w"\n        sizes="(max-width: 400px) 100vw, 400px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><em>The Renaissance Man, a depiction of the Full-Stack Developer during the Renaissance Period of 1600s Europe. The extra arms allows for efficient multitasking between frontend and backend.</em></p>',fields:{tagSlugs:["/tags/blog/","/tags/beginner/","/tags/general/"]},frontmatter:{title:"In the Beginning There Was Darkness",tags:["Blog","Beginner","General"],date:"2018-08-28T21:48:58.174Z",description:"This is the first post in what will hopefully be many more to come. Here, I formally declare the motivation and goals behind this blog and formulate a structure for future content."}}},pathContext:{slug:"/posts/in-the-beginning-there-was-darkness/"}}}});
